import React from "react";
import landingPic from "./undraw_printing_invoices_5r4r.svg";
const Landing = () => {
  return (
    <div>
      <div className="row row-space">
        <div className="col-2">
          <div className="landingh1">
            <h2 className="landingText"> Welcome to </h2>
            <h2 className="landingText"> Receipt & Expense Managment System</h2>
          </div>
        </div>
        <div className="col-2">
          <img src={landingPic} alt="landingPic" className="landingPic"></img>
        </div>
      </div>
    </div>
  );
};

export default Landing;
